  r: '8',
  key: '4ej97u'
}], ['line', {
  x1: '21',
  y1: '21',
  x2: '16.65',
  y2: '16.65',
  key: '1p50m8'
}], ['line', {
  x1: '11',
  y1: '8',
  x2: '11',
  y2: '14',
  key: 'jw7mvq'
}], ['line', {
  x1: '8',
  y1: '11',
  x2: '14',
  y2: '11',
  key: '1nivud'
